import React from "react";
import "./NavBar.css";

const NavBar = () => {
  return (
    <div class="navbar">
      <a href="#landingPage">Home</a>
      <div class="dropdown">
        <button class="dropbtn">
          Dropdown
          <i class="fa fa-caret-down"></i>
        </button>
        <div class="dropdown-content">
          <a href="#/">Link 1</a>
          <a href="#/">Link 2</a>
          <a href="#/">Link 3</a>
        </div>
      </div>
    </div>
  );
};

export default NavBar;
